    textField: {
        width:"40px",
        margin: "-6px 10px 0px 10px"
    },
    redText: {
        fontFamily: 'Schoolbell',
        color: "red"
    },
    textContainer: {
        display: "flex",
        flexDirection: "column",
        justifyContent: "center",
        alignItems: "center",
    },
    passwordForm: {
        boxShadow: "4px 4px 4px rgba(0, 0, 0, 0.25)",
        backgroundColor: "#3A3A3A",
        width: "350px",
        height: "213px"
    }
});

export default styles;
